import React from "react";

// props.fav == {fav}
function Food({fav}){
  return <h1>I like {fav}</h1>
}

function App() {
  return (
  <div>
    <h1>Hello!!!</h1>
    <Food fav="kimchi"
     something={true}
     papapapa={["hello",1,2,3,4,true]} />
  </div>);

}



export default App;
